import { useEffect, useState } from "react";
import "./Showcase.css";

const Showcase = () => {
    const [data, setData] = useState();

    useEffect(() => {
        fetch("/Showcase").then((data) => {
            setData(data);
            console.log(data);
        });
    }, []);

    return (
        <div className="showcase-container">
            <h1 className="showcase-header">Showcase Page</h1>
            <p className="showcase-body">showcase body</p>
            {console.log(data)}
            {/* {!data ? (
                <p>...Loading</p>
            ) : (
                data.data.map((d, i) => {
                    return <p key={i}>{d}</p>;
                })
            )} */}
        </div>
    );
};

export default Showcase;
